    "Low-Cost, High-Performance Combustion Chamber for LOX/CH4 Propulsion Project",nt"tracking_summary":
    {ntt"total": 3,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-06T21:14:17.834558",nt"name": "low-cost-high-performance-combustion-chamber-for-lox-ch4-propulsion-project",nt"isopen":
    true,nt"url": null,nt"notes": "Ultramet will design and fabricate a lightweight,
    high temperature 5-lbf combustion chamber for use with cryogenic liquid oxygen/methane
    (LOX/CH4) propellant that will deliver a specific impulse of ~355 seconds, an increase
    over the current 320-sec baseline that will result in a propellant mass decrease
    of 55 lbm. The material system will be based on Ultramet's proven oxide-iridium/rhenium
    architecture, which has been successfully hot-fire tested with stoichiometric oxygen/hydrogen
    for hours. Instead of rhenium, however, the structural material will be a niobium
    alloy that has excellent high temperature yield strength. With a yield strength-to-weight
    ratio over 33&#37; greater than that of rhenium at elevated temperature, this niobium
    alloy will significantly reduce chamber weight. The starting materials are two orders
    of magnitude less expensive than rhenium and are less expensive than the C103 alloy
    commonly used in low-performance engines. Aerojet will design the chamber in Phase
    I and will perform hot-fire testing in Phase II. Phase II will include scaleup of
    the process and testing of a chamber in the 25- to 500-lbf thrust class, which would
    be suitable for a reaction control system engine on a lunar ascent/descent vehicle.",nt"license_title":
